import logo from './logo.svg';
import './App.css';
import { useEffect, useState } from 'react';

export const NumbersMain = () => {

  useEffect(() => {
    getNumbers();
  }, []);

const getNumbers = () =>
{
  // axios.get("https://qrng.anu.edu.au/API/jsonI.php?length=1&type=uint8&#8217")
  // .then((response)=>{
  //   if (response.status==200){
  //     console.log(response.data);
  //   }
  // });

  const numbers = [1,1,1,1,2,3,4,4,4,4,6,6,77,6,6,7,7,7,7,7,8,10,21,21,21,10,1,3,4,4,11,10,77,99];
  console.log(numbers);
  var newArray = [];
  newArray = numbers.filter(function(e,pos){
    return numbers.indexOf(e) === pos;
  });
  console.log(newArray);
}
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;

export const SortSort = () =>
{
